/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

const divStyle = css`
  background: #eb5d0e;
  color: white;
  font-size: 24px;
  border-radius: 4px;
  padding: 32px;
  text-align: center;
`;

const Button = ({ text, onClick }: any) => {
  return (
    <div css={divStyle} onClick={onClick}>
      {text}
    </div>
  );
};

export default Button;
